.publish.bunny {
  background-repeat: no-repeat;
  background-position: center center;
  background-size: contain;
  opacity: 0.65;
  position: absolute;
  z-index: -1;
  /* This expression assumes that --min-panel-content-width is an integer number of pixels.
     Unfortunately, round() is not widely supported yet. */
  width: calc(275 * clamp(0px, var(--min-panel-content-width) - 600px, 1px));
  height: 155px;
}

.publish.bunny.right {
  top: -10px;
  right: calc(-1 * var(--diff-padding) - 12px);
}

.publish.bunny.left {
  top: 8px;
  left: calc(-1 * var(--diff-padding) - 46px);
}

.publish.bunny.right.pending, .pulish.bunny.right.published {
  animation: slide-in-left 0.5s forwards, fade-in-out 1s;
}

.publish.bunny.left.pending, .publish.bunny.left.published {
  animation: slide-in-right 0.5s forwards, fade-in-out 1s;
}

.counter.wrapper i {
  height: 1em;
  margin-right: 0.25em;
}

.ui.label {
  margin:-0.15em 0.45em -0.15em 0.5em;
  padding: 0.3em 0.8em;
  background-color: var(--grey-5);
  color: var(--text-color-inverted) !important;
  text-align: center;
  line-height: 10.5625px;
  vertical-align: baseline;
}

.publish.button.wrapper >>> .ui.button.auxiliary {
  display: flex;
  width: 100%;
}

.summary.wrapper >>> .draft.ribbon.label {
  margin: 0px 2px 7px;
  padding: 2px 13px 2px 26px;
}

.pending.actions.wrapper {
  position: relative;
  display: flex;
  column-gap: 4em;
  margin: auto;
  margin-bottom: 2em;
}

.mark.reviewed.wrapper, .mark.read.wrapper {
  display: flex;
  position: relative;
  justify-content: space-between;
}

.summary.published.indicator {
  font-size: 2em;
  position: absolute;
  inset: -0.5em -0.5em 0 -0.5em;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: hsl(var(--bg-base-hsl), 0.9);
  z-index: 1000;
}

.review.summary.published.tennis.racquet.icon {
  transform: rotate(-90deg);
}

.ui.mark.all.reviewed.button, .ui.mark.all.read.button {
  position: absolute;
  top: -0.5em;
  left: 0;
  min-width: 200px;
}

.ui.mark.all.read.button {
  right: 0;
}
